import React from 'react';
import {View,Text} from 'react-native';


export default class App extends React.Component{
  render(){
    return(
      <View style={{
        flex: 1,
        justifyContent: 'center',
        alignContent: 'center',
      }}>
        <Text>IU</Text>
      </View>
    )
  }

}
